const lobby = (state = {}, action) => {
  switch (action.type) {
    case 'SET_LOBBY_ID':
      return {
        ...state,
        id: action.lobbyId
      };
    case 'SET_LOBBY':
      console.log(action);
      return action;
    default:
      return state;
  }
}

export default lobby;
